ArvoreSintatica* analiseSintatica_SLR1(Token *tokens, ArvoreSintatica *arvoreSintatica){
	int i, j, estado, k=0, node_f=0;
	Pilha *pilhaSLR;
	Par par;
	Producoes prods;

	//0 = estado inicial
	pilhaSLR = NULL;
	pilhaSLR = push(0, pilhaSLR);
	par.acao = 's'; //valor 'inicial'

	while(   ( par.acao == 's') || (par.acao == 'r')   ){
		par = tabela_acoes[ top(pilhaSLR) ][ indiceSimbolo(tokens[k].token) ];

		//printf("\n==========\nPilha: ");
		//imprimirPilha(pilhaSLR);
		//printf("\n{%c,  %d} - TA[ Top: %d] [ indice %d]", par.acao, par.numero, top(pilhaSLR), indiceSimbolo(tokens[k]));
		//getchar();

		arvoreSintatica = (ArvoreSintatica*) realloc(arvoreSintatica, (node_f+1) * sizeof(ArvoreSintatica));
		arvoreSintatica[node_f].node.token = VAZIO;

		//le o simbolo e desloca pra proximo estado
		if(par.acao =='s'){
			estado = tabela_transicao[ top(pilhaSLR) ][ indiceSimbolo(tokens[k].token) ];
			//printf("\nD: estado %d veio da tabela_TT[ %d] [ %d ]\n", estado, top(pilhaSLR), indiceSimbolo(tokens[k]));

			pilhaSLR = push(tokens[k].token, pilhaSLR);
			pilhaSLR = push(estado, pilhaSLR);

			arvoreSintatica[node_f].node = tokens[k];
			arvoreSintatica[node_f].pai = NULL;
			arvoreSintatica[node_f].n_filhos = 0;
			arvoreSintatica[node_f++].filhos = NULL;
			k++;

		}else if(par.acao == 'r'){//reducao
			//printf("\n{%c, %d}, ", par.acao, par.numero);
			prods = producoesG[par.numero];

			//deveria ir pra producao L,1_  Tabela_acoes errada
			for(i=0; i < 2*prods.num_tokens_dir; i++)
				pilhaSLR = pop(pilhaSLR);

			estado = tabela_transicao[ top(pilhaSLR) ][ indiceSimbolo(prods.terminal_esq) ];
			//printf("vai para o estado %d encontrado na tabela TT [ %d][ %d]", estado, top(pilhaSLR), indiceSimbolo(prods.terminal_esq));
			pilhaSLR = push(prods.terminal_esq, pilhaSLR);
			pilhaSLR = push(estado, pilhaSLR);

			arvoreSintatica[node_f].node.token = prods.terminal_esq;
			arvoreSintatica[node_f].pai = NULL;
			arvoreSintatica[node_f].n_filhos = prods.num_tokens_dir;
			arvoreSintatica[node_f].filhos = (ArvoreSintatica*) malloc( (prods.num_tokens_dir+1) * sizeof(ArvoreSintatica) );
			j = node_f;


			if(prods.num_tokens_dir==0){
				arvoreSintatica[node_f].filhos[0].node.token = VAZIO;
			}
			else
				for(i = (node_f - prods.num_tokens_dir); i < node_f ; i++){
					arvoreSintatica[node_f].filhos[i + prods.num_tokens_dir- node_f] = arvoreSintatica[i];
					arvoreSintatica[i].pai = (ArvoreSintatica*) malloc( sizeof(ArvoreSintatica) );
					*(arvoreSintatica[i].pai) =	arvoreSintatica[node_f];
				}

			node_f -= prods.num_tokens_dir;
			arvoreSintatica[node_f++] = arvoreSintatica[j];

		}//if da reducao
	}//while

	p_free(pilhaSLR);
	if(par.acao == 'a')
		return arvoreSintatica;

	return NULL;
}

