void imprimirArvore(ArvoreSintatica *arv){
	int i;

	if(arv!=NULL){
		printf("\n{Token %d}", arv->node.token);
		if(arv->node.token > 20)
			printf(" [%s]",arv->node.nome);
		for(i=0; i < arv->n_filhos; i++)
			imprimirArvore(&arv->filhos[i]);
	}
}

/*************************************************************/


Pilha *p_alloc(void){
	return (Pilha *) malloc(sizeof(Pilha));
}

/*************************************************************/

Pilha *p_free(Pilha *p){
	Pilha *aux;
	while(p!=NULL){
		aux = p;
		p = p->prox;
		free(aux);
	}

	return p;
}
/*************************************************************/

Pilha *push(int e, Pilha *p){
	Pilha *new = p_alloc();

	new->elemento = e;
	new->prox = p;
	p = new;
	return p;
}

/*************************************************************/

Pilha *pop(Pilha *p){
	Pilha *aux;

	if(p!=NULL){
		aux = p;
		p = p->prox;
		free(aux);
	}

	return p;
}

/*************************************************************/

int top(Pilha *p){

	if(p!=NULL)
		return p->elemento;

	return -1;
}

/*************************************************************/

int indiceSimbolo(int s){
	int i = 0;


	while((s != simbolosGramatica[i]) && (i <= n_simbolos))
		i++;
//	if(s!=simbolosGramatica[i])	printf("\nERRO NO SIMBOLO!\n");

	return i;
}

/*************************************************************/

void imprimirPilha(Pilha *p){

	if(p->prox!=NULL)
		imprimirPilha(p->prox);

	printf("%d, ", p->elemento);
}

